import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<header class="m-4">
  <button
    class="md:hidden transition-all bg-salad-500 hover:bg-salad-600 active:bg-violet-700 focus:outline-none focus:ring focus:ring-violet-300">
    <span class="sr-only">Menu
    </span>
    <svg id="menu" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5"
      stroke="currentColor" class="w-6 h-6">
      <path stroke-linecap="round" stroke-linejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5" />
    </svg>
  </button>
  <img src="./../../../../assets/logo.png" alt="Valley View Logo">
</header>
